import React from 'react'
import styled from 'styled-components'

import { NavLink } from 'react-router-dom'
import house from '../Images/house.png'

const DeFi: React.FC = () => {


    return (
        <StyledContainer>
        <StyledSectionsHolder>
        <StyledSections to='/' exact><img width="50px" height="50px" src={house} alt='house to show that this is a button to home'/></StyledSections>
        </StyledSectionsHolder>

        </StyledContainer>
    )
}

const StyledContainer = styled.div`
display: flex;
flex-flow: column;
margin-left: auto;
margin-right: auto;
border-radius: 4px;
justify-content: center;
width: 80%;
height: 90%;
background-color: #008B8B;
`
const StyledInnerContainer = styled.div`
display: flex;
flex-flow: row;
margin-top: 80px;
margin-left: auto;
margin-right: auto;
justify-content: center;
width: 80%;
height: 15%;
`
const StyledSections = styled(NavLink)`
    height: 10%;
    width: 10%;
    padding:2%;
`
const StyledSectionsHolder = styled.nav`
    position: absolute;
    color:unset;
    text-decoration: none;
    top: 3%;
    left: 3%;
    height: 15%;
    width: 15%;
    display: flex;
`

export default DeFi
